105.body:
Can you think of a good place in the game so far to create a timer? We can! In the bathroom, of course! Confused? Let's say Foxy wanted to use the bathroom. As it stands, Foxy can open the door to the bathroom and step in. When she's done looking around, she exits the bathroom and can close the door behind her. But what if she wanted to close the door while she's in the bathroom; you know, for whatever she may want to do in there. And, while she's doing her, ahem, business, we can't be telling her to do anything else, and, most importantly, we can't watch! The first thing we need to do is to create a way for Foxy to close the door while she's in the bathroom. Since, most likely, the reason to close the door would be to use the toilet, we should have Foxy close the door when she interacts with the toilet. Start by creating a hotspot on the toilet to interact with it. Edit the bathroom by double-clicking Edit room under Rooms and Bathroom in the Project Tree. Choose to view Hotsposts and hHotspot1 and use the line tool to outline and fill in the toilet as in Figure 7.1 . This will create Hotspot 1 in the room. Change the hotspot's description to Toilet and name it hToilet. Figure 7.1: Toilet Hotspot There's one more thing we have to add to this room before we go on. You guessed it, a door. Remember that the bathroom door is actually part of the Main Hall room and not the bathroom so, in order to be able to close the door while in the bathroom, we have to add a door to this room. The door picture we used for the Main Hall is too small for this room, but we did create a new image that would fit in our bathroom. Double-click on Sprites in the Project Tree and click on the Objects folder. You should see our bathroom door in there. Add a new object by right-clicking and choosing to import a new sprite from a file. Choose the file named BathroomDoor2.bmp and click the Import button to import the whole image. You should see a new door object show up as in Figure 7.2 . Our new object is ready to be created. Go back to editing the bathroom and choose to view Objects . Right-click in the room and choose Place New Object Here . You should see the familiar blue cup show up. Click on the cup and modify its properties as in Figure 7.3 . Notice that our StartX is 60 and StartY is 3. When Foxy walks into the room the door is open. Having the StartY set at 3 places the door at the top of the room. Notice also that the baseline of the door is overridden and set at 198. In order for the door to appear in front of Foxy the baseline must be higher than Foxy's. But, in order for the door to appear behind the walk-behind the baseline must be lower than the walk-behind's. The walk-behind's baseline is set at 199, so we made the door's 198, which should always be higher than Foxy's because if she ever walked beyond that she'd leave the room. Figure 7.2: Added another door object Figure 7.3: Door Properties One other thing we have to do with the door is make sure it's hidden behind the wall. We need to extend our walk-behinds for this. Choose to view Walk-behinds and select the first walk-behind, then use the line and fill tools to extend the current walk-behind area to look like Figure 7.4 . Figure 7.4: Expanding our walk-behind area to cover the entire wall. Now let's add a function for Foxy interacting with the hotspot. Select the hotspot and then click the lightning bolt (events) button in the properties box on the right and add a function to the Interact hotspot event by clicking on the ellipses on the right ( Figure 7.5 ). This will create a function called hToilet_Interact() and take you to the script editor. Figure 7.5: Create a funtion for interacting with the toilet Edit the script as follows: function hToilet_Interact()
{ oDoor.Move(oDoor.X, 250, 3, eBlock, eAnywhere); Wait(5*40); oDoor.Move(oDoor.X, 3, 3, eBlock, eAnywhere);
} The Move function should already be familiar to you. The first thing we do is move the door down to close it. The last thing we do is move the door back up. The middle is the interesting part. We call the Wait() function. That function does exactly what it says, it waits. How long it waits depends on the number we pass in, which should be in game loops. Since there are 40 game loops a second, we tell it to wait 200 game loops, or 5 seconds. Easy as pi. Well actually pi is 3.1415 so that would screw everything up. Don't use pi.

108.body:
Blue, sun, television. Just thought we'd start with a few random words. Remember what happens when Foxy talks to Dork? Here's the stimulating conversation that ensues when Foxy interacts with Dork: Foxy : Hi! My name is Foxy. Dork : Quack, quack, quack. Foxy : Oh, I thought you could talk. Dork : Quaaaaaack! Foxy : I feel silly talking to a duck. Dork : Thanks a lot! The same conversation happens every time. It would be a lot more pleasurable if Dork said some random remark when Foxy spoke with him. The current conversation is too precious to get rid of though so what we should do is have the conversation take place the first time Foxy talks to Dork, but then have a random Dorky remark every time after that. Let's start by making our current conversation happen only once. Open the global script by finding it in the File menu or by pressing Ctrl+Shift+G . Scroll all the way to the bottom and you should see the cDork_Talk() function that we previously added with our delightful conversation. Remember our good old friend the DoOnceOnly() function? No? Shame on you! Go back and read about it in Chapter 4 . I mean it mister! Now, put all the code that is already in the cDork_Talk() function in a DoOnceOnly() block as follows: if (Game.DoOnceOnly("FirstTalkWithDork") == true)
{ <Stuff already there goes here>
} Now if you run the game and talk to Dork he'll only respond once. Go and try it while we wait... Now that Dork will only go through the whole conversation once, let's add some random remarks for him to say for every conversation after the first one. We're going to just show you the final function and then we'll go through and explain it. Make the cDork_Talk() function look like the following and notice that the new parts have a "new" comment next to them. function cDork_Talk()
{ int myRandomNumber; // new cFoxyMonk.Walk(cDork.x - 20, cDork.y, eBlock, eWalkableAreas); // new (moved) cFoxyMonk.FaceCharacter(cDork); // new (moved) if (Game.DoOnceOnly("FirstTalkWithDork") == true) { cFoxyMonk.Say("Hi! My name is Foxy."); cDork.Say("Quack, quack, quack."); cFoxyMonk.Say("Oh, I thought you could talk."); cDork.Say("Quaaaaaack!"); cFoxyMonk.Say("I feel silly talking to a duck."); cDork.Say("Thanks a lot!"); cDork.Say("&1 Quack-quack-quack-quack quack-quack-quack-quack!"); } else // this whole 'else' block is new { cFoxyMonk.Say("Hey there again."); myRandomNumber = Random(4); if(myRandomNumber == 0) { cDork.Say("Quack, quack and stuff."); } else if(myRandomNumber == 1) { cDork.Say("I'm a little duck and I like the water."); } else if(myRandomNumber == 2) { cDork.Say("I wonder if I can fly away from you."); } else if(myRandomNumber == 3) { cDork.Say("You're a fox and you have wings!!!???? WOW!!!."); } else if(myRandomNumber == 4) { cDork.Say("The planets will allign soon enough."); } }
} In order to generate a random message every time Foxy interacts with Dork, the first thing we need to do is generate a random number. And when we generate this random number, we have to store it somewhere so we can use it later. That's where the first line comes into play. int myRandomNumber; This line declares a variable called myRandomNumber that is of the integer type. That means the variable can hold a number in it. Now, notice that we moved the Walk and FaceCharacter functions out of the if block as well. We did this because no matter what conversation will take place, Foxy will need to walk over to Dork and face him first. Let's look at the else block now. If we've already gone through the first conversation once with Dork, then the DoOnceOnly() function will return false and the code in the else block will run. In this block three things will happen. First, Foxy will say hey again to Dork. Then, a random number between 0 and 4 inclusive will be generated by this line: myRandomNumber = Random(4); This will give us 5 possible values (0, 1, 2, 3, 4) that we can use. To get this random number we call the Random() function passing it a maximum. Since we passed it 4, we will not get a number greater than 4 back. Now notice what's on the left of the equal sign? That's right! It's our variable. The Random() function gives us back our random number and we have to store it somewhere or we will lose it. We put it into our variable myRandomNumber. I'm sure you know that the variable can be named anything you like, but our name is best, so THERE!! Now that we have a random number between 0 and 4 inclusive stored in our variable, we do the third thing in the else block, and that is to check our random number and choose something for Dork to say based on it. For that we use an if/else if block. And that's it! Save, run, have fun. Side Note: For more information on variables please see Appendix I .

118.body:
Analogous to the goto-dialog and goto-previous script commands for switching between dialogs, there are some predefined constant return values that can be used in AGS Scripts that are embedded in Dialog Scripts. The three values available are RUN_DIALOG_GOTO_PREVIOUS, RUN_DIALOG_RETURN and RUN_DIALOG_STOP_DIALOG. RUN_DIALOG_GOTO_PREVIOUS goes back to the previous dialog just like goto-previous does in Dialog Scripts; RUN_DIALOG_RETURN goes back to the current conversation just like the return keyword does in Dialog Scripts; and RUN_DIALOG_STOP_DIALOG stops the dialog just like the stop keyword would. These will be easier to understand with an example. Let's modify Dork's dialog to use one of these return values. Go to the dialog editor and delete the line "cDork: Well, what would you like to know?" between the @S symbol and the return keyword, and replace it with the following code: if(dAboutDork.GetOptionState(1) == eOptionOff && dAboutDork.GetOptionState(2) == eOptionOff && dAboutDork.GetOptionState(3) == eOptionOff)
{ cDork.Say("What else do you want to know? I've already told you everything!"); return RUN_DIALOG_GOTO_PREVIOUS;
} else
{ cDork.Say("Well, what would you like to know?");
} Be absolutely sure that the whole block is indented as in Figure 8.6 . Figure 8.6: Indenting AGS Script in Dialog Script So, what have we done here? The if statement will check each of our first 3 options to see if it is on or off. If all of the first 3 options are turned off, it means that Foxy already asked Dork everything, so Dork tells her he has nothing more to say and we return RUN_DIALOG_GOTO_PREVIOUS to return us to the previous conversation. If any of the first 3 options is still there, then Dork will say what he said before we made these changes and Foxy will see the available options to ask him.

121.body:
Start by right-click on GUIs in the Project Tree and click on New GUI . Name the new GUI gHALTalk. All we need is a place for the player to type in some text and an OK button, so shrink its Height property to 30 and the Width to 300. We also don't want this GUI to show up all the time, so change its Visible property to False. Now if you look at the toolbar, you'll see some buttons that add components to the GUI. Use these buttons to add a text box and a button to the GUI to take up most of the space on it and change the text on the button to 'Talk'. Name the text box txtHAL and the button btnHAL. Figure 8.7 shows the toolbar buttons (red arrow) and the final result after adding the button and text box. Figure 8.7: Our Simple Text Box GUI Since this GUI is going to be used in our new room so Foxy can talk to the giant red eye, we need to make sure it's positioned correctly in that room, and that it actually shows up when Foxy enters the room. We also want it to disappear when Foxy leaves. Go back to editing the new room, and add a function for the Enters room after fade-in event and add the following code: function room_AfterFadeIn()
{ gHALTalk.SetPosition(10, 160); gHALTalk.Visible = true;
} We set the x positon to 10 to center the box and set the y postion to 160 to place it under the giant red eye, then we make the box visible. Add a function for the Leaves room event and add the following code: function room_Leave()
{ gHALTalk.Visible = false;
} And there you have it. When Foxy enters the room, the box shows up and when she leaves, the box disappears. Only two things left to do: Make a way for Foxy to be able to enter this room and write the text parsing code. We'll leave the text parsing for last since that's our ultimate objective. Let's create a way for Foxy to get into this room now.

123.body:
Go back to the text parser and add the following words by right-clicking and choosing Add new word . Once you click Add , you can edit the word in the Properties Pane. hello
what
your
name Go back to editing the new gHALTalk GUI and add a function for the OnClick event of the button (click on the button to see its properties and events.) Notice that this function will appear in the global script. Make the function look like the following: function btnHAL_OnClick(GUIControl *control, MouseButton button)
{ String input; input = txtHAL.Text; Parser.ParseText(input); if (Parser.Said("hello what your name")) { Display("Hello there. I HAL"); cFoxyMonk.Say("You mean you're HAL?"); Display("No, my name is iHal"); } else if (Parser.Said("hello")) { Display("Hello to you"); } else if (Parser.Said("what your name")) { Display("i Hal"); } else Display("say what now?");
} Now, let's dissect this mess: We first declare a String called input. This string will hold the text that the player types into the GUI. The text box in our GUI is called txtHAL, so we get the Text property of the text box and place it into the String input. Now that input contains what the player typed in, we call the parser's function ParseText to parse it for us. Once the parser parses our text, we can have a series of IF/ELSE blocks to check what the player typed in. As you can see, we check for the string "hello what your name" and leave out ignored words like "is". Also notice that the parser will get rid of punctuation marks and ignore word case. The player can enter in "Hello, what is your name" or "hello, what's your name" and it would still work. Play with that and then come back and add the following words to the text parser: Can
You
Know
Tell
About
Duck Then add a synomym for the word 'duck' by right-clicking it and choosing Add synomym from the menu. Type in 'goose' for the synomym and notice that it has the same Word Group number as 'duck'. Now, add two else blocks to the OnClick function like the following: else if (Parser.Said("what can you tell about duck"))
{ Display("I know nothing of noisy birds");
}
else if (Parser.Said("tell about duck"))
{ Display("I know nothing of noisy birds");
} As you can see, now we can ask iHal about Dork the Duck, but we could also use the word 'goose' since it's a synonym for 'duck'. We can say the following: What can you tell me about the duck? (with or without the question mark)
What can you tell me about the goose? (with or without the question mark)
What can you tell about duck? (with or without the question mark)
What can you tell about goose? (with or without the question mark)
Tell me about the duck. (with or without the 'me' or the period)
Tell me about the goose. (with or without the 'me' or the period) Since iHal will respond the same way for each of these blocks, we should find a way to combine them. Replace the blocks with the following: else if (Parser.Said("what,tell [can] [you] [tell] about duck") )
{ Display("I know nothing of noisy birds");
} Let's dissect this code: We separated 'what' and 'tell' with a comma. This tells the parser to take either one as the first word. The comma acts like an 'or' in this case: 'what' or 'tell' will do. The following three words are in brackets. This tells the parser that they're optional. This allows us to be able to ask the same questions as above and have less code. We can combine the first and third blocks too to make the code look like this: if (Parser.Said("[hello] what your name"))
{ Display("Hello there. I HAL"); cFoxyMonk.Say("You mean you're HAL?"); Display("No, my name is iHal");
}
else if (Parser.Said("hello"))
{ Display("Hello to you");
}
else if (Parser.Said("what,tell [can] [you] [tell] about duck") )
{ Display("I know nothing of noisy birds");
}
else Display("Say what now?"); But what if Foxy said something else after the 'hello'? like "hello, how are you today?" or "hello there you big ugly red thing" and what if we don't care about what comes after the hello unless it's "what your name". This would be a good place to use the MatchRestOfInput word type. Change the second ELSE/IF to: else if (Parser.Said("hello rol")) This will take anything after the word 'hello' and just ignore it. So now you can either say "hello, what's your name" or "hello <anything goes here>" and Hal will respond accordingly. Now, what if we asked Hal about something other than a duck or a goose. Add one more ELSE/IF statement as follows: else if (Parser.Said("what,tell [can] [you] [tell] about anyword") )
{ Display("I'm sorry Dave, but I can't tell you that.");
} Put that block right under the similar one asking about the duck. Notice that the last word is now 'anyword' which is the MatchAnyWord type. So, the text parser will match that to anything we put in there. Ask Hal to tell you about donuts.

124.body:
We would say that now you've got the basic idea of the text parser and can create more complicated conversations. There are just a few things that need to be taken care of though before we can call this finshed: There's no way to exit the Hal room. We have to use the mouse to click the 'Talk' button. After talking, what we typed in is still there and we have to delete it to say something else. Let's start with number 1 and go down the list (uh huh). Exiting the room should be simple. All we have to do is add a 'bye' or 'see you later' option to the conversation and exit the room when that happens. See the code below for the final full conversation. function btnHAL_OnClick(GUIControl *control, MouseButton button)
{ String input; input = txtHAL.Text; Parser.ParseText(input); if (Parser.Said("[hello] what your name")) { Display("Hello there. I HAL"); cFoxyMonk.Say("You mean you're HAL?"); Display("No, my name is iHal"); } else if (Parser.Said("hello rol")) { Display("Hello to you"); } else if (Parser.Said("what,tell [can] [you] [tell] about duck") ) { Display("I know nothing of noisy birds"); } else if (Parser.Said("what,tell [can] [you] [tell] about anyword") ) { Display("I'm sorry Dave, but I can't tell you that."); } else if (Parser.Said("bye rol") || Parser.Said("See you,ya rol") || Parser.Said("have,got,gotta [got] go")) { Display("Bye Dave"); cFoxyMonk.ChangeRoom(4); } else Display("Say what now?");
} Please note that we also had to add the following words to the text parser: bye
have
got
go
gotta
later
see
ya Now to exit the room we can say any of the following: Bye
Bye bye
Bye bye now (or anything after 'bye')
See you (and anything after that like 'see you later bro')
See ya (and anything after that)
I have to go
I have got to go
I got to go
Got to go
Have to go
Gotta go That's a lot of stuff. Not bad huh? Let's move on to the second point. It could get very annoying to have to click the 'Talk' button to say something. It would be much easier if you can just hit the Enter key to say something. Adding this event is very simple. Edit the gHALTalk GUI. Select the text box and look at its events in the Properties Pane. You'll notice there is only one event called OnActivate. This is the event for the Enter key being pressed. Create a function for this event by clicking the ellipses. Function txtHAL_OnActivate() will be created. Now create another function called TalkToHal() right above the btnHAL_OnClick() function, and move all of the code inside the btnHAL_OnClick() function into this new function. For the last step, have btnHAL_OnClick() and txtHAL_OnActivate() both call your new TalkToHal() function. One more thing to tackle and we're done. Let's clear the text box after Enter is hit or the 'Talk' button clicked. Add the line txtHAL.Text = ""; right under the the line input = txtHAL.Text; in the TalkToHal() function. This will clear the text box after we get what was typed in. The final code follows: function TalkToHal()
{ String input; input = txtHAL.Text; txtHAL.Text = ""; Parser.ParseText(input); if (Parser.Said("[hello] what your name")) { Display("Hello there. I HAL"); cFoxyMonk.Say("You mean you're HAL?"); Display("No, my name is iHal"); } else if (Parser.Said("hello rol")) { Display("Hello to you"); } else if (Parser.Said("what,tell [can] [you] [tell] about duck") ) { Display("I know nothing of noisy birds"); } else if (Parser.Said("what,tell [can] [you] [tell] about anyword") ) { Display("I'm sorry Dave, but I can't tell you that."); } else if (Parser.Said("bye rol") || Parser.Said("See you,ya rol") || Parser.Said("have,got,gotta [got] go")) { Display("Bye Dave"); cFoxyMonk.ChangeRoom(4); } else Display("Say what now?");
} function btnHAL_OnClick(GUIControl *control, MouseButton button)
{ TalkToHal();
} function txtHAL_OnActivate(GUIControl *control)
{ TalkToHal();
}

129.body:
In order to make the cutscene we will use the 'after fade in' function that is available to us in each room. We'll create a function for the 'after fade in' event and put all of our cutscene code in it. This way, when the room loads, the function will run and the cutscene will play through. At the end of the cutscene we will change rooms to room 1. Go back to editing room 6. Click the lightning bolt to show the room events and then click the ellipses next to Enters room after fade-in to create the function. See Figure 9.1 . Figure 9.1: Creating the 'after fade in' Function So that we don't forget the very important cutscene functions, let's go ahead and add them in now, and we'll go ahead and add the room change while we're at it. Make the room_AfterFadeIn() function look like the following: function room_AfterFadeIn()
{ StartCutscene(eSkipAnyKeyOrMouseClick); //TODO: Do cutscene stuff here EndCutscene(); cFoxyMonk.ChangeRoom(1);
} As you can see, we start the cutscene and tell it that any key press or mouse click can be used to skip it. Then we have a comment that reminds us to fill in the good stuff, and then we end the cutscene. After the cutscene is over, we have Foxy change rooms to room 1 to start the game. Be sure to put in the change room call after the cutscene is done. Now for the actual cutscene code, we'll do something simple. We'll have Foxy introduce the game for us and then start the game. But, before we do this, save the game, and run it just to see what would happen. You should see Foxy come up against a black background, which is our Intro room, then fade to room 1; exactly what we need. Let's have Foxy introduce the game now. Delete the comment in the code if you wish and add a line for Foxy to say "Hi, I'm Foxy. Welcome to Foxy's Quest!" While we're at it, let's add some actual speech. Make sure there's a sound file called Foxy1.wav in the Speech folder of your game. We, of course, have one for you, but you can make your own. Then make the line look like this: cFoxyMonk.Say("&1 Hi, I'm Foxy. Welcome to Foxy's Quest!"); The &1 will tell AGS to play the Foxy1.wav file while the speech is displayed. Run this and watch it. Then run it again and click the mouse or press a button before the speech is done and it should be skipped. And that is the simplest cutscene in the world.

130.body:
We'll move away a bit from the cutscene now to introduce overlays. Since we're making an intro, this would be a good place for it. Overlays can be either text or graphical and when placed on the screen are always on top of everything else. Let's create a few overlays to show the game's name and authors on the screen. The name of the game will be a graphical overlay and the authors' names will be text overlays. Start by going to the sprites editor and importing the file named GameNameOverlay.png . This is an image we created for the name of the game. If you don't like it, well, make your own then. Just remember, it needs to fit the screen. We created a sub-folder under Sprites named Overlays in which to put the image, just so we can keep everything organized. Our image was placed in slot 75 in the Sprites editor. Yours may be different. Go back to editing the Intro room's script. Right before Foxy introduces the game, place the following lines: Overlay *ovTitle;
ovTitle = Overlay.CreateGraphical( 0, 10, 75, false ); And right after Foxy's line place the following lines: Wait(20);
ovTitle.Remove(); Let's examine what we just did. The first line we added declares a variable called ovTitle that will hold our overlay. Notice, however, that there's a * before it. The * means that this is a pointer variable. A pointer variable holds the address of a variable and not the contents of the variable. If this is all foreign to you, then just remember that when declaring overlay variables, they need a * before them. (See Appendix I for scripting help and the */pointer stuff). The second line actually creates the graphical overlay. It places it at x,y coordinates (0,10), uses our newly imported image, which is 75, and sets the transparency to false. This overlay can be referenced by our variable ovTitle now. The third line is a wait. We've seen the Wait() function before. This one waits for 20 game cycles, or about 0.5 seconds. The last line calls the Remove() function of the overlay to remove it. It's always good to remove your overlays when you're done with them. Creating the text overlays for the author names is even easier because there are no images to import. We are, however, going to create a new view for Foxy to make things look neater. This should be a quick and easy view composed of one loop and one frame. Right-click on Views and choose New View . Call it vFMPoint. Create a new loop and then go back to the Sprites editor. Find the sprite of Foxy pointing. On ours it's number 49. Right-click that sprite and assign it to our new view. That's it. Now we have a pointing view. te the text overlays, we're going to declare overlay variables, and then call the CreateTextual() function instead of the CreateGraphical() function. Add the following: Overlay *davesName;
Overlay *georgesName;
davesName = Overlay.CreateTextual( 70, 60, 100, eFontNormal, 10, "David Ensminger" );
georgesName = Overlay.CreateTextual( 190, 60, 100, eFontNormal, 10, "A. G. Madi" ); The CreateTextual() function is very similar to the graphical one. It takes and x,y pair for text placement, a size (100), a font (eFontNormal, eFontSpeech, or eFontOutline), a color code (We used 10 just randomly, but it's a nice color), and the actual text to display. Let's improve a bit on this cutscene now by making Foxy move around a bit and introduce the game developers. All the code for this should be familiar to you by now so we'll just show it to you here. There are three things to note though. One is the fact that we don't have walkable areas in this room, so we tell Foxy to walk anywhere. You could make walkable areas instead, but there's just no need in this case. Two is the fact that we change Foxy's view to that of our newly created pointing view. This makes Foxy point at the authors' names when she introduces them. Just don't forget to change it back when you're done with it. And three is the fact that we bring Foxy back to her starting position when she's done with the introductions. This is to make sure she starts at that position when the scene changes to room 1. Of course, there are other ways to do this, but this is the one we chose. function room_AfterFadeIn()
{ StartCutscene(eSkipAnyKeyOrMouseClick); Overlay *ovTitle; ovTitle = Overlay.CreateGraphical( 0, 10, 75, false ); Overlay *davesName; Overlay *georgesName; davesName = Overlay.CreateTextual( 70, 60, 100, eFontNormal, 10, "David Ensminger" ); georgesName = Overlay.CreateTextual( 190, 60, 100, eFontNormal, 10, "A. G. Madi" ); int x = cFoxyMonk.x; int y = cFoxyMonk.y; cFoxyMonk.Say("&1 Hi, I'm Foxy. Welcome to Foxy's Quest!"); cFoxyMonk.Walk(110, 120, eBlock, eAnywhere); cFoxyMonk.LockView(VFMPOINT); Wait(40); cFoxyMonk.UnlockView(); cFoxyMonk.Walk(240, 120, eBlock, eAnywhere); cFoxyMonk.LockView(VFMPOINT); Wait(40); cFoxyMonk.UnlockView(); cFoxyMonk.Walk(x, y, eBlock, eAnywhere); cFoxyMonk.FaceDirection(eDirectionDown); Wait(20); EndCutscene(); davesName.Remove(); georgesName.Remove(); ovTitle.Remove(); cFoxyMonk.ChangeRoom(1);
}

131.body:
The EndCutscene() function needs to be examined a little closer since it actually returns a value. If you recall, the function will return a 0 if the player actually watched the entire cutscene and 1 if the player skipped it. We're going to use this value to yell at the player for skipping our cutscene. are an integer variable at the top of the intro function and call it iYellAtPlayer: int iYellAtPlayer; Change the EndCutScene() line to the following: iYellAtPlayer = EndCutscene(); Right after that line and before the change room line, add the following: if(iYellAtPlayer == 1)
{ cFoxyMonk.Say(" What!!??? How dare you not watch my cutscene!!"); Wait(20); cFoxyMonk.Say(" WELL FINE THEN!"); Wait(40);
} Now, when you skip the intro, you'll get yelled at. Notice also that Foxy will end up at the final position no matter when the intro is skipped. Remember that's because when a player skips a cutscene, AGS actually fast forwards through it and executes every instruction in there really fast.

133.body:
Since we have an intro, we think it would only be fitting to also have some end credits. Creating end credits is just as simple as creating an intro. We will create a new room and put a cutscene in it. Let's dive right in. Create a new room and call it End Credits . Set the ShowPlayerCharacter option to False, because we don't need to see Foxy when the credits are rolling. Now, create a function for the room's after fade-in event and create a cutscene in that function. This is very much just like making the intro. In the cutscene, we're going to create a text overlay and scroll it up the screen with whatever text we want in it. The two important things that we need in order to scroll the credits are changing the position of the text overlay and changing the text of the text overlay. To change the position, we set the text overlay's x and y values; to change the text, we call the text overlay's SetText() function. The SetText() function takes the overlay width, font type, color, and text as parameters. These are the same parameters that Overlay.CreateTextual() takes except for the x and y coordinates. The code follows: function room_AfterFadeIn()
{ Overlay *ovTitle; Overlay *textScroller; int i; int j; StartCutscene(eSkipAnyKeyOrMouseClick); textScroller = Overlay.CreateTextual( 120, 200, 100, eFontNormal, 41725, "Foxy's Quest" ); i = 0; while(i < 5) { while(textScroller.Y > -30) { textScroller.Y = textScroller.Y - 1; Wait(1); } if(i == 0) textScroller.SetText(100, eFontNormal, 41725, "Written by[David Ensminger[A.G. Madi"); else if(i == 1) textScroller.SetText(100, eFontNormal, 41725, "Produced by[David Ensminger[A.G. Madi"); else if(i == 2) textScroller.SetText(100, eFontNormal, 41725, "Directed by[David Ensminger[A.G. Madi"); else if(i == 3) textScroller.SetText(100, eFontNormal, 41725, "Voiced by[David Ensminger[A.G. Madi[T.J. Madi"); textScroller.Y = 200; i++; } EndCutscene(); textScroller.Remove(); ovTitle = Overlay.CreateGraphical( 0, 10, 80, false ); Wait(200); ovTitle.Remove(); QuitGame(0);
} Let's dissect this code. The first few lines should be familiar to you. We declare two overlays; one for the text that we will be scrolling and one for the game's name that we will display at the end of the credits. We create the text overlay first with the name of the game and set its Y coordinate to 200, which sets it at the bottom of the screen, and, since AGS uses the top left corner of the overlay for the coordinates, this effectively puts the overlay below the screen, and makes it look like it's coming up from below. Now for some loops, but not the same kind of loops that we did with with sprites back in Chapter 2 . We're going to create scripting loops. We haven't done scripting loops before, and technically, we don't have to do them now, but this is a great time to learn them. Loops enable us to do the same thing multiple times without having to copy and paste the same code over and over again. AGS gives us the while loop; which allows us to do something WHILE something else is true. We are going to use 2, separate, while loops: One loop will be used to change the text of the overlay, and the other loop will be used to move the overlay up on the screen. The first loop will run 5 times because we have 5 text overlays that we want to show: The name of the game, 'Written by', 'Produced by', 'Directed by', and 'Voiced by'. So, we set a variable, i, equal to zero to start out and we tell AGS to run the code in the while loop WHILE i is less than 5, and each time through the loop we call i++, which is scripting talk for adding 1 to the i variable. This gives us five loops when i is 0, 1, 2, 3, and 4. As soon as i reaches 5, the while(i < 5) will be false and the loop will end. By the way, everything between the { and } gets done each time through the loop. So, this outer while loop will scroll the overlay up the screen, change the overlay's text depending on what the i variable is, add 1 to i, and start over. The second while loop is inside the first and it does the actuall scrolling of the overlay up the screen. Each time through the loop we subtract 1 from the Y coordinate of the overlay, which moves it up a pixel, and we wait for 1 game loop, so the overlay doesn't just fly up the screen. (In fact, take the wait out and you won't even see any scrolling because the overlay will move so fast.) We do this while the Y coordinate is grater than -30. Why -30 you ask; because that way it scrolls completely off the screen and puts a bit of a pause between each subsequent overlay scroll. You may have noticed that there are [ characters in our strings. And, if you already ran the game, you probably know that this tells AGS to put whatever is after the [ character on a new line. Just thought we'd mention that.

